import React, { useState } from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { useEffect } from 'react';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Form from 'react-bootstrap/Form';
import { login } from '../services/api';

function MyNavbar({ token, setToken, activeKey, setActiveKey, setActiveUserId }) {
  const [showLogin, setShowLogin] = useState(false);
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [loginError, setLoginError] = useState('');
  // Session timer
  const [seconds, setSeconds] = useState(0);
  
  useEffect(() => {
    if (!token) {
      setSeconds(0);
      return;
    }
    setSeconds(0);
    const interval = setInterval(() => setSeconds(s => s + 1), 1000);
    return () => clearInterval(interval);
  }, [token]);
  
  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const res = await login({ username, password });
      setToken(res.data.token);
      localStorage.setItem('token', res.data.token);
	  console.log('Login successful:', res.data);
      setShowLogin(false);
      setLoginError('');
    } catch (err) {
      setLoginError('Invalid credentials');
    }
  };

  return (
    <>
      <Navbar expand="lg" className="bg-body-tertiary shadow-sm">
        <Container fluid>
          <Navbar.Brand href="#home">Manager de inventario</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav 
			className="me-auto"
			activeKey={activeKey}
	        onSelect={setActiveKey}
			>
			<Nav.Link eventKey="productos" href="#home">Productos</Nav.Link>
              <Nav.Link eventKey="categorias" href="#link">Categorias</Nav.Link>
              {token && (
                <Nav.Link eventKey="usuarios" href="#usuarios">Usuarios</Nav.Link>
              )}
            </Nav>
          </Navbar.Collapse>
          <Col xs="auto">
            {!token ? (
              <Button variant="secondary" onClick={() => setShowLogin(true)}>
                Login
              </Button>
            ) : (
              <Button variant="outline-danger" onClick={() => { setToken(null); localStorage.removeItem('token'); }}>
                Logout
              </Button>
            )}
          </Col>
        </Container>
      </Navbar>

      <Modal show={showLogin} onHide={() => setShowLogin(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Login</Modal.Title>
        </Modal.Header>
        <Form onSubmit={handleLogin}>
          <Modal.Body>
            <Form.Group>
              <Form.Label>Username</Form.Label>
              <Form.Control
                type="text"
                value={username}
                onChange={e => setUsername(e.target.value)}
                required
              />
            </Form.Group>
            <Form.Group className="mt-2">
              <Form.Label>Password</Form.Label>
              <Form.Control
                type="password"
                value={password}
                onChange={e => setPassword(e.target.value)}
                required
              />
            </Form.Group>
            {loginError && <div className="text-danger mt-2">{loginError}</div>}
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={() => setShowLogin(false)}>
              Cancel
            </Button>
            <Button type="submit" variant="primary">
              Login
            </Button>
          </Modal.Footer>
        </Form>
      </Modal>
    </>
  );
}

export default MyNavbar;
